import React from 'react';
import { useLocation } from 'react-router-dom';
import { BookedContainer, BookedDetails, BookedWrapper } from './landing.styles';
import Titanic from '../../assets/Titanic.gif';

const LandingPage = () => {
	const location = useLocation();
	return (
		<div className="main">
			<BookedContainer>
				<BookedWrapper>
					<img src={Titanic} alt="Nice gif!" style={{ margin: '10px' }} />
					<h2>Deine Buchung wurde bestätigt! ⚓</h2>
					<BookedDetails>Details:</BookedDetails>
					{location.state ? <h3>{location.state?.details.name}</h3> : null}
				</BookedWrapper>
			</BookedContainer>
		</div>
	);
};

export default LandingPage;
